// Background.js
import React from 'react';
import './Background.scss';
import backgroundLeft from '../../images/backgroundLeft.png';
import backgroundRight from '../../images/backgroundRight.png';
import indexBackground from '../../images/indexBackground.png';

const Background = ({ children }) => {
  return (
    <div className="background-container">
      <div className="background-images">
        <div
          className="background-image background-left"
          style={{ backgroundImage: `url(${backgroundLeft})` }}
        ></div>
        <div
          className="background-image background-right"
          style={{ backgroundImage: `url(${backgroundRight})` }}
        ></div>
        <div
          className="background-image index-background"
          style={{ backgroundImage: `url(${indexBackground})` }}
        ></div>
        {children}
      </div>
    </div>
  );
};

export default Background;
